public static Collection plus(Collection left, Collection right) {
        Collection answer;
        if (left instanceof Set)
            answer = new HashSet();
        else
            answer = new ArrayList(left.size() + right.size());
        answer.addAll(left);
        answer.addAll(right);
        return answer;
    }

