public CountDownLatch preparePeriod(final MediaPeriod mediaPeriod, final long positionUs) {
    final ConditionVariable prepareCalled = new ConditionVariable();
    final CountDownLatch preparedCountDown = new CountDownLatch(1);
    runOnPlaybackThread(
        new Runnable() {
          @Override
          public void run() {
            mediaPeriod.prepare(
                new MediaPeriod.Callback() {
                  @Override
                  public void onPrepared(MediaPeriod mediaPeriod) {
                    preparedCountDown.countDown();
                  }

                  @Override
                  public void onContinueLoadingRequested(MediaPeriod source) {
                    // Do nothing.
                  }
                },
                positionUs);
            prepareCalled.open();
          }
        });
    prepareCalled.block();
    return preparedCountDown;
  }

public FutureRecordMetadata tryAppend(byte[] key, byte[] value, CompressionType compression, Callback callback) {
        if (!this.records.hasRoomFor(key, value)) {
            return null;
        } else {
            this.records.append(0L, key, value, compression);
            FutureRecordMetadata future = new FutureRecordMetadata(this.produceFuture, this.recordCount);
            if (callback != null)
                thunks.add(new Thunk(callback, this.recordCount));
            this.recordCount++;
            return future;
        }
    }

