public static int memStrLen2(ByteBuffer buffer, int from) {
		int to = from;
		while ( to < buffer.limit() ) {
			if ( buffer.get(to) == 0 && to < buffer.limit() - 1 && buffer.get(to + 1) == 0 )
				break;
			to += 2;
		}
		return (to - from) >> 1;
	}

