public static String toString(List<?> list, String separator) {
		if (list == null) {
			return null;
		}

		StringBuffer buffer = new StringBuffer("[ ");
		for (int i = 0; i < list.size(); i++) {
			buffer.append(list.get(i).toString());
			if (i + 1 < list.size()) {
				buffer.append(separator);
			}
		}

		buffer.append(" ]");
		return buffer.toString();
	}

