public static boolean isDateToday(final Date date) {
        if (date == null) {
            return false;
        }
        final Date now = new Date();
        if (now.getTime() - MILISECONDS_IN_18_HOURS > date.getTime() || now.getTime() + MILISECONDS_IN_18_HOURS < date.getTime()) {
            return false;
        } else {
            return true;
        }
    }

