		if (log.isDebugEnabled())
		{
			log.debug("Added distance based runtime node lookup: " + 0 + ":" + rootNodeLookup.hashCode());
			log.debug("Added distance based runtime node lookup: " + 1 + ":" + childNodesLookup.hashCode());
