private List<LNode> dfs(final LNode node, final List<LNode> component) {
        if (node.id == 0) {
            node.id = 1;
            List<LNode> c = component;
            if (c == null) {
                c = new LinkedList<LNode>();
            }
            c.add(node);
            for (LPort port1 : node.getPorts()) {
                for (LPort port2 : port1.getConnectedPorts()) {
                    dfs(port2.getNode(), c);
                }
            }
            return c;
        }
        return null;
    }

