    boolean fEq = (family == null && tp.family == null) || Bytes.equals(family, tp.family);
    boolean qEq = (qualifier == null && tp.qualifier == null) ||
                   Bytes.equals(qualifier, tp.qualifier);
    return tEq && fEq && qEq;
  }

