      if (!StorageDirId.isUnknown(storageDirIdLocked)) {
        mLockedBlockIds.put(blockId, new HashSet<Integer>());
        mLockedBlockIds.get(blockId).add(blockLockId);
        mLockedBlockIdToStorageDirId.put(blockId, storageDirIdLocked);
