public boolean removeAll (BooleanArray array) {
		int size = this.size;
		int startSize = size;
		boolean[] items = this.items;
		for (int i = 0, n = array.size; i < n; i++) {
			boolean item = array.get(i);
			for (int ii = 0, nn = size; ii < nn; ii++) {
				if (item == items[ii]) {
					removeIndex(ii);
					size--;
					break;
				}
			}
		}
		return size != startSize;
	}

