public int removeByField(IndexDefinition<T> indexDefinition, Object value) {
    FieldIndex<T> index = mIndices.get(indexDefinition);

    if (index == null) {
      return 0;
    }

    Set<T> toRemove = index.getByField(value);
    if (toRemove == null) {
      return 0;
    }
    int removed = 0;
    for (T o : toRemove) {
      if (remove(o)) {
        removed++;
      }
    }
    return removed;
  }

