static Page remove(Page p, Object key) {
        // TODO avoid separate lookup
        if (p.find(key) == null) {
            return p;
        }
        p = p.copyOnWrite();
        Page top = p;
        Page parent = null;
        int parentIndex = 0;
        while (true) {
            if (parent != null) {
                parent.children[parentIndex] = p.id;
            }
            int index = p.findKey(key);
            if (p.isLeaf()) {
                if (index >= 0) {
                    p.remove(index);
                } else {
                    // not found?
                    throw new RuntimeException("Not found: " + key);
                }
                if (p.size() == 0) {
                    if (parent != null) {
                        parent.remove(parentIndex);
                        // TODO recursive, or on the way down
                    }
                }
                break;
            }
            if (index < 0) {
                index = -index - 1;
            }
            parent = p;
            parentIndex = index;
            p = p.map.readPage(p.children[index]);
            p = p.copyOnWrite();
        }
        return top;
    }

