	{
		LeafEntry<K, V> entry = firstEntry;
		while ( entry != null )
		{
			int result = btree.compare( entry.getKey( ), key );
			if ( result == 0 )
			{
				return entry;
			}
			if ( result > 0 )
			{
				return null;
			}
			entry = entry.getNext( );
		}
		return null;
	}

