public static boolean wildcardMatch(String patterns, String str) {
    	for (String pattern: splitAndTrim(patterns)) {
    		if (pattern.startsWith("+"))
    			pattern = pattern.substring(1);
    		if (pattern.startsWith("-")) {
    			pattern = pattern.substring(1);
    			if (SelectorUtils.match(pattern, str))
    				return false;
    		} else {
    			if (SelectorUtils.match(pattern, str))
    				return true;
    		}
    	}
    	return false;
    }

