                        sha3(block.getHeader().getEncodedWithoutNonce()),
                        ByteUtil.byteArrayToLong(block.getHeader().getDifficulty()));
                Pair<byte[], byte[]> pair = hashimotoLight(block.getHeader(), nonce);
