		int size = textViewList.size();
		int constant = 0;
		if (size > 2)
			constant = 2;
		else
			constant = size;

		if (checkTextView != null
				&& !checkTextView.getText().equals(
						textViewList.get(size - constant).getText())) {
			checkTextView = textViewList.get(size - constant);
			return false;
