            if (calling != null && !calling.isAncestorOf(loader)) {
                smgr.checkPermission(new RuntimePermission("getClassLoader"));
            }
        }

        if (this.isPrimitive()) {
            return null;
        }

        if (loader == null) {
            loader = BootClassLoader.getInstance();
        }

        return loader;
    }

