            componentType = javaType.getComponentType();
            if (componentType.isArray()) {
                while (componentType.isArray()) {
                    dimString += "[]";
                    componentType = componentType.getComponentType();
                }
            }
            componentTypeName =
                    types.getQNameString(types.getTypeQName(componentType)) +
                    dimString;
