      } else {
        return new Result(0, "", "");
      }
    } else {
      LOG.debug(String.format("Not performing chgrp command for file %s " +
          "because current OS is not Linux ", path));
      return new Result(-1, "", "Cannot perform operation: The current OS is not Linux");
    }
  }

