static Gen<Long> choose(long min, long max) {
        if (min > max) {
            throw new IllegalArgumentException(String.format("min > max: %s > %s", min, max));
        }
        if (min == max) {
            return ignored -> min;
        } else {
            return random -> {
                final double d = random.nextDouble();
                return (long) ((d * max) + ((1.0 - d) * min) + d);
            };
        }
    }

