        setAsParentNodeOf(dimension);
        return this;
    }

public Vector computeCentroid() {
    if (centroid != null)
      return centroid;
    if (pointProbSum == 0) {
      return weightedPointTotal;
    } else if (centroid == null) {
      // lazy compute new centroid
      centroid = weightedPointTotal.divide(pointProbSum);
    }
    return centroid;
  }

