            initializeIntent();
        }
        boolean success = false;
        if (intent != null) {
            LogManager.d(TAG, "attempting callback via intent: %s", intent.getComponent());
            intent.putExtra(dataName, data);
            try {
                context.startService(intent);
                success = true;
