public static Zone getDefaultQiniuZone() {
        // Get zone from setting
        String qiniuZone = OPTIONS.get("qiniu_zone");

        if (StrUtil.isBlank(qiniuZone)) {
            return Zone.autoZone();
        }

        Zone zone;

        switch (qiniuZone) {
            case "z0":
                zone = Zone.zone0();
                break;
            case "z1":
                zone = Zone.zone1();
                break;
            case "z2":
                zone = Zone.zone2();
                break;
            case "na0":
                zone = Zone.zoneNa0();
                break;
            case "as0":
                zone = Zone.zoneAs0();
                break;
            default:
                // Default is detecting zone automatically
                zone = Zone.autoZone();
        }

        return zone;
    }

